validate-test(node: class benchmark-node )

    err: class error;
    x,y: class g2-window;

begin
	
    for x = each g2-window do
        if the g2-window-management-type of x exists and the g2-window-management-type of x = the symbol remote then
        y = x;
    end;

    begin
        wait for 2 seconds;
        call nols-validate-bpn-model ("sine-model", sine-validation-data-set-x , sine-validation-data-set-y, y) ;
    end on error(err)
        begin
            call fail(node, "Validate failed");
            return;
        end;
    end;

    call pass(node);

end

