re-launch-test(node: class benchmark-node )

    err: class error;
    x,y: class g2-window;
    installation-dir, dir-sep, file-path: text;
    version-struct: structure;
    
begin

    version-struct = call g2-get-g2-version-information();
    installation-dir = call grtl-get-installation-directory();
    dir-sep = call grtl-get-file-system-delimiter();
    if the enterprise of version-struct then begin
        file-path = "[installation-dir][dir-sep]..[dir-sep]..[dir-sep]test-gnne[dir-sep]ent";
    end else begin
        file-path = "[installation-dir][dir-sep]..[dir-sep]..[dir-sep]test-gnne[dir-sep]std";
    end;
	conclude that the nols-studio-home-directory of gnne-demo-studio-setting = file-path;

    for x= each g2-window do
        if the g2-window-management-type of x exists and the g2-window-management-type of x = the symbol remote then
            y = x;
    end;
    begin
        call nols-launch-nolstudio-by-setting(gnne-demo-studio-setting ,y);
        wait for 5 seconds;
    end on error(err)
        begin
            call fail(node, "Launch failed");
            return;
        end;
    end;
    call pass(node);
end

kill-all-processes-test(node: class benchmark-node )
    err: class error;
    x, y: class g2-window;
begin
    for x = each g2-window do
        if the g2-window-management-type of x exists and the g2-window-management-type of x = the symbol remote then
            y = x;
    end;
    begin
        call nols-kill-remote-studio(y);
        call nols-kill-remote-process();
    end on error(err)
        begin
            call fail(node, "failed");
            return;
        end;
    end;
    call pass(node);
end

launch-gnne-and-train-bpn-test(node: class benchmark-node)

    err: class error;
    x, y: class g2-window;
    RPC: class gnne-rpc-interface;
    MechName, execution-command, writable-directory: text;
    installation-dir, dir-sep: text;
    version-struct: structure;
    
begin

    version-struct = call g2-get-g2-version-information();
    installation-dir = call grtl-get-installation-directory();
    dir-sep = call grtl-get-file-system-delimiter();
    if the enterprise of version-struct or true then begin
        execution-command = "[installation-dir][dir-sep]dst[dir-sep]nol[dir-sep]opt[dir-sep]x64[dir-sep]ntnol.exe";
    end else begin
        execution-command = "[installation-dir][dir-sep]dst[dir-sep]nol[dir-sep]opt[dir-sep]ntnol.exe";
    end;

    writable-directory = "[installation-dir][dir-sep]dst[dir-sep]"; 

    for x = each g2-window do
        if the g2-window-management-type of x exists and the g2-window-management-type of x = the symbol remote then
            y = x;
    end;
    begin
        for RPC = each gnne-rpc-interface do
            make RPC transient;
            delete RPC;
        end;
        RPC = call _gnne-create-default-rpc ();   
        conclude that _gnne-rpc-object = the name of RPC; 
        MechName = call g2-get-host-name();
        conclude that the machine-name of RPC = MechName;
        conclude that the execution-command of RPC = execution-command;
        conclude that the writable-directory of RPC = writable-directory;
        call GNNE-LAUNCH-REMOTE-PROCESS(y);
        call gnne-train-bpn(sine-model, sine-data-set, train-output, 400, 1, false);
    end on error(err)
        begin
            call fail(node, "failed");
            return;
        end;
    end;
    call pass(node);
end
